from flask import Flask, render_template

app = Flask(__name__)

@app.route("/")
def index():
    return render_template("index.html")

@app.route("/teksts")
def teksts():
    return render_template("teksts.html")

@app.route("/saraksts")
def saraksts():
    saraksts = ["Anna", "Katls", "Kartupelis"]
    bildes = ["data:image/webp;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,"]
    kopejais_saraksts = [["Anna", "data:image/webp;base64,"], ["Katls", "data:image/jpeg;base64,"], ["Kartupelis", "data:image/jpeg;base64,"]]
    return render_template("saraksts.html", vardi = saraksts, bildes = bildes, garums = len(saraksts), visi = kopejais_saraksts)

if __name__ == "__main__":
    app.run(port = 5000)
